css:
atom-text-editor,
:host {
  background-color: #fdf6e3;
  color: #657b83;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #cad0d0;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #cad0d0;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #eee8d5;
  color: #657b83;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 1;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #d33682;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #002b36;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #eee8d5;
}
atom-text-editor .line-number.cursor-line,
:host .line-number.cursor-line {
  background-color: #e7dec3;
}
.bracket-matcher .region {
  background-color: #93a1a1;
  opacity: 0.5;
}
.comment {
  color: #93a1a1;
  font-style: italic;
}
.entity {
  color: #b58900;
}
.entity .punctuation {
  color: #dc322f;
}
.entity.other.attribute-name.placeholder.scss {
  color: #6c71c4;
}
.entity.other.attribute-name.placeholder.scss .punctuation.definition.entity.scss {
  color: inherit;
}
.keyword {
  color: #859900;
}
.keyword.other.special-method {
  color: #cb4b16;
}
.storage.type {
  color: #859900;
}
.storage.modifier {
  color: #859900;
}
.constant {
  color: #b58900;
}
.constant.numeric,
.constant.boolean,
.constant.symbol,
.constant.symbol .punctuation {
  color: #2aa198;
}
.constant.symbol.hashkey {
  color: #dc322f;
}
.constant.symbol.hashkey .punctuation {
  color: #dc322f;
}
.delimiter,
.brace {
  color: #dc322f;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.method .name {
  color: #268bd2;
}
.operator.assignment {
  color: #93a1a1;
}
.parameter {
  color: #93a1a1;
}
.property-name {
  color: #859900;
}
.property-value .unit {
  color: #839496;
}
.string {
  color: #2aa198;
}
.string .constant.character.escape {
  color: #dc322f;
  font-weight: bold;
}
.string .punctuation.string {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .string.regexp.arbitrary-repetition {
  color: #dc322f;
}
.variable {
  color: #268bd2;
}
.variable.constant {
  color: #b58900;
}
atom-text-editor .gfm .markup.italic,
:host .gfm .markup.italic {
  font-style: italic;
}
atom-text-editor .gfm .markup.bold,
:host .gfm .markup.bold {
  font-weight: bold;
}
atom-text-editor .gfm .markup.heading,
:host .gfm .markup.heading {
  color: #cb4b16;
}
atom-text-editor .gfm .link,
:host .gfm .link {
  color: #2aa198;
}
atom-text-editor .gfm .link .entity,
:host .gfm .link .entity {
  color: #6c71c4;
}
atom-text-editor .gfm .raw,
:host .gfm .raw {
  font-style: italic;
}
atom-text-editor .gfm.support,
:host .gfm.support {
  color: #dc322f;
}
.source.ruby .meta.embedded .punctuation.section {
  color: #dc322f;
}
.source.ruby .string.regexp {
  color: #dc322f;
}
.terminal {
  background-color: #fdf6e3;
}
.terminal .color-0 {
  color: #657b83;
}
.terminal .background-0 {
  background-color: #fdf6e3;
}
.terminal .color-1 {
  color: #dc322f;
}
.terminal .background-1 {
  background-color: #dc322f;
}
.terminal .color-2 {
  color: #859900;
}
.terminal .background-2 {
  background-color: #859900;
}
.terminal .color-3 {
  color: #b58900;
}
.terminal .background-3 {
  background-color: #b58900;
}
.terminal .color-4 {
  color: #268bd2;
}
.terminal .background-4 {
  background-color: #268bd2;
}
.terminal .color-5 {
  color: #d33682;
}
.terminal .background-5 {
  background-color: #d33682;
}
.terminal .color-6 {
  color: #2aa198;
}
.terminal .background-6 {
  background-color: #2aa198;
}
.terminal .color-7 {
  color: #002b36;
}
.terminal .background-7 {
  background-color: #002b36;
}
atom-text-editor .gutter .git-line-modified,
:host .gutter .git-line-modified {
  border-left: 2px solid #b58900;
  padding-left: calc(0.5em - 2px);
  color: #657b83;
}
atom-text-editor .gutter .git-line-added,
:host .gutter .git-line-added {
  border-left: 2px solid #859900;
  padding-left: calc(0.5em - 2px);
  color: #657b83;
}
atom-text-editor .gutter .git-line-removed,
:host .gutter .git-line-removed {
  border-left: 2px solid #dc322f;
  padding-left: calc(0.5em - 2px);
  color: #657b83;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #cad0d0;
}
.source.scala {
  color: #93a1a1;
}
.source.scala .declaration {
  color: #93a1a1;
  font-weight: bold;
}
.source.scala .comparison {
  color: #93a1a1;
}
.source.scala .class,
.source.scala .type {
  color: #b58900;
  font-weight: normal;
}
.source.scala .val {
  font-weight: normal;
  color: #93a1a1;
}
.source.scala .variable {
  font-weight: bold;
  color: #93a1a1;
}
.source.scala .variable.parameter {
  color: #6c71c4;
  font-weight: normal;
}
.source.scala .control.flow {
  color: #93a1a1;
  font-weight: bold;
}
.source.scala .constant.language {
  color: #93a1a1;
  font-weight: bold;
}
.source.scala .function.declaration {
  color: #6c71c4;
}
.source.scala .modifier.other {
  font-weight: bold;
}
.source.scala .package {
  color: #93a1a1;
}
.source.scala .variable.import {
  font-weight: normal;
}
.source.scala .type .bounds,
.source.scala .type .class {
  color: #6c71c4;
}
.source.scala .documentation .class,
.source.scala .documentation .parameter {
  color: #586e75;
}
.source.scala .documentation .description {
  color: #93a1a1;
}
.source.scala .quasiquote {
  font-style: italic;
}
.source.scala .string-interpolation .expression *:not(.margin),
.source.scala .quasiquote .expression *:not(.margin),
.source.scala .string-interpolation .variable,
.source.scala .quasiquote .variable {
  font-style: italic;
}
.source.scala .string-interpolation .variable,
.source.scala .quasiquote .variable {
  font-weight: normal;
}
